import PropTypes from 'prop-types';

const items = ({title, sentence, image}) => {
    const items = Array.from(Array(4).keys()).map(i => {
    return (
        {
            title: [items.title],
            sentence : [items.sentence],
            image : [items.image]
        }
    )
    })
}


export const SecondList = ({items}) => {
    return (
         <div className="list mb-4">
                    <div className="list-item flex items-center justify-start p-2 space-x-4">
                        <img
                            src={items.image}
                            alt="media"
                            className="h-20 w-30 shadow-lg  shadow-outline"

